import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const Home = () => {
    return (
        <div id="home">
            <h1>Aplikasi JWT</h1>
            <button className="btn btn-warning me-2">Login</button>
            <button className="btn btn-primary">Postingan</button>
        </div>
    );
};

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<Home />}></Route>
                    {/* <Route path="/login" element={<Home />}></Route> */}
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
